import React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const Record = () => {
  function createData(Movie, Category, Direction, ReleaseYr, Poster) {
    return { Movie, Category, Direction, ReleaseYr, Poster };
  }

  const rows = [
    createData('Tenet', 'Sci-Fi', 'Christopher Nolan', 2010, <img src="data:image/jpeg;base64,"alt="null"width="100"height="100"></img>),
    createData('The Dark Knight', 'Action', 'Christopher Nolan', 2008, <img src="data:image/jpeg;base64,"alt="null"width="100"height="100"img></img>),
    createData('Interstellar', 'Sci-Fi', 'Christopher Nolan', 2014, 'N/A'),
    createData('Dunkirk', 'War', 'Christopher Nolan', 2017, 'N/A'),
    createData('Inception', 'Sci-Fi', 'Christopher Nolan', 2020, 'N/A'),
  ];

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="movies table">
        <TableHead>
          <TableRow>
            <TableCell>Movie</TableCell>
            <TableCell align="right">Category</TableCell>
            <TableCell align="right">Direction</TableCell>
            <TableCell align="right">Release Year</TableCell>
            <TableCell align="right">Poster</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.Movie}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.Movie}
              </TableCell>
              <TableCell align="right">{row.Category}</TableCell>
              <TableCell align="right">{row.Direction}</TableCell>
              <TableCell align="right">{row.ReleaseYr}</TableCell>
              <TableCell align="right">{row.Poster}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default Record;